import styles from "./PublicPost.module.scss";
console.log(styles);
export function PublicPost() {
  const boxPost = [
    { url: "/public/ico/box_post/item_photo.svg", class: styles.postPhoto, sep: "" },
    { url: "/public/ico/box_post/item_video.svg", class: styles.postVideo, sep: "" },
    { url: "/public/ico/box_post/item_audio.svg", class: styles.postAudio, sep: "" },
    { url: "/public/ico/box_post/item_article.svg", class: styles.postArticle, sep: "" },
    {
      url: "/public/ico/box_post/item_short_video.svg",
      class: styles.postShort,
      sep: `${styles.sep} sep`,
    },
    {
      url: "/public/ico/box_post/BestFriendsSettingsEntrypoint__layout.svg",
      class: styles.postSettings,
      sep: "",
    },
  ];
  return (
    <div className={`${styles.box_post} boxBorder`}>
      <div>
        <img src="" alt="" />
        <input type="text" />
      </div>
    </div>
  );
}
